import React from 'react'


class Friends extends React.Component{
 

  constructor(props){
    super(props)

    this.state={
      members: props.friendsList
    }
  }
 
  render(){
    return(
      <div>

       
        <span>
          {this.state.members.map((items,index)=>(
          <div key={index}>
          {items} <button>Delete</button>
          </div>
          ))}
        </span>
      </div>
    )
  }
}


export default Friends;
